import styled from 'styled-components'

const HeaderMenuItem = ({props}) => {
  props.map(v =>
    v.map(value => {
      console.log(value)
    })
  )
  return (
    <DropDownMenuBox>
      <MenuItem>
        <MentItemTitle>개발</MentItemTitle>
        <MenuItemText>웹 개발자</MenuItemText>
        <MenuItemText>서버 개발자</MenuItemText>
        <MenuItemText>자바 개발자</MenuItemText>
        <MenuItemText>소프트웨어 개발자</MenuItemText>
        <MenuItemText>안드로이드 개발자</MenuItemText>
        <MenuItemText>iOS 개발자</MenuItemText>
        <MenuItemText>데이터 엔지니어</MenuItemText>
      </MenuItem>
    </DropDownMenuBox>
  )
}
const DropDownMenuBox = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  height: 625px;
  max-width: 1060px;
  width: 100%;
  height: 100%;
`
const MenuItem = styled.div`
`
const MentItemTitle = styled.div`
  position: relative;
  font-size: 17px;
  color: #333;
  line-height: 20px;
  vertical-align: top;
  padding-right: 20px;
  padding-bottom: 15px;
  width: 100%;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
`
const MenuItemText = styled.div`
  position: relative;
  font-size: 13px;
  color: #999;
  padding: 5px 20px 5px 0;
  width: 100%;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
`

export default HeaderMenuItem;
